const DUMMY_REVIEWS_DATA = {
    id: 1,
    title: "Underground Railroad", 
    author: "Colson Whitehead"
};


const ReviewsSummary = () => {
    const params = useParams();
    const { bookId } = params;

    return (
        <p>A summary of {bookId}</p>
    );
};

export default ReviewsSummary;
